import React from "react";
import Header from "../Components/Header";

const MainLayout = ({ children }) => {
  return (
    <React.Fragment>
      <div className="position-relative " style={{ minHeight: "100vh" }}>
        <Header />
        {children}
      </div>
    </React.Fragment>
  );
};

export default MainLayout;
